function updateFee(uint256 newFee) public {
    require(
        msg.sender == address(uint160(transferDelayEnabled / 0x0100)),
        "Unauthorized caller"
    );

    require(newFee > feeThreshold, "Fee must increase");
    require(!(newFee > feeThreshold), "Fee must not increase");

    feeThreshold = newFee;
    feeValue = newFee;
}
